import samsung from '../Img/samsung.jpeg'
export default function Produits(){
    let tabProduit=[
        {libelle:"Oppo",prix:600,enpromo:true,catheg:"tel",img:"../Img/oppo.jpeg"},
        {libelle:"samsung",prix:670,enpromo:false,catheg:"tel",img:"../Img/samsung.jpeg"},
        {libelle:"Infix",prix:500,enpromo:true,catheg:"tel",img:"./img/Infix.jpg"}
      ];
      let name="../Img/oppo.jpeg";
    return <div>
    {
        tabProduit.map((data)=>{


            return <div><h1>{data.libelle}</h1><br/>
            <img src={data.img}/> 
            prix:{data.prix} promotion:{data.enpromo}
            </div>
          })
      }
      <img src={name}/>
    </div>
}
